description:
1. bên mua phải thanh toán lệ phí trước bạ và các loại thuế, phí, lệ phí có liên quan đến việc cấpgiấy chứng nhận theo quy định của pháp luật khi bên bán làm thủ tục cấp giấy chứng nhận chobên mua và trong quá trình sở hữu, sử dụng căn hộ kể từ thời điểm nhận bàn giao căn hộ;2. bên mua có trách nhiệm nộp thuế và các loại phí, lệ phí, chi phí (nếu có) theo quy định cho nhànước khi thực hiện bán căn hộ đã mua cho người khác;153. bên bán có trách nhiệm nộp các nghĩa vụ tài chính thuộc trách nhiệm của bên bán cho nhà nướctheo quy định của pháp luật;
căn hộ biển cao cấp welltone luxury residence sở hữu lâu dài ở nha trang
. giao nhận căn hộ1. điều kiện giao nhận căn hộ:a. bên bán đã hoàn thành xong việc xây dựng căn hộ, nhà chung cư và các công trình hạ tầng kỹthuật, hạ tầng xã hội theo tiến độ ghi trong dự án đã được phê duyệt, bảo đảm kết nối với hệ thốnghạ tầng chung của khu vực; trường hợp bàn giao căn hộ xây thô thì phải hoàn thiện toàn bộ phầnmặt ngoài của căn hộ đó,diện tích sử dụng căn hộ thực tế chênh lệch không quá+/- 05% (nămphần trăm) so với diện tích sử dụng căn hộghi trong hợp đồng. trường hợp diện tích sử dụngcăn hộ thực tế chênh lệch vượt quá +/- 05% (năm phần trăm) so với diện tích sử dụng căn hộ ghitrong hợp đồng nhưng bên mua đồng ý nhận bàn giao thì các bên tiến hành điều chỉnh giá báncăn hộ theo quy định tại điểm b khoản 1 điều 2 của hợp đồng.b. khi bên mua đã hoàn thành đầy đủ các nghĩa vụ thanh toán theo hợp đồngvà đã hoàn tất toàn bộviệc khắc phục các vi phạm (nếu có) trước khi nhận bàn giao căn hộ, cụ thể như sau:- thanh toán đủ 95% (chín mươi lăm phần trăm) giá bán căn hộ; thuế giá trị gia tăng tươngứng;- thanh toán đủ 100% kinh phí bảo trì;- kinh phí quản lý vận hành nhà chung cư 03 (ba) tháng đầu tiên theo thông báo của bên bán.- các khoản tiền lãi, tiền phạt do vi phạm hợp đồngvà các khoản phải trả khác (nếu có) màbên mua có nghĩa vụ phải thanh toán theo hợp đồngvà quy định của pháp luậtwelltone luxury residence
